import React from 'react'
import './DanceTour.css'
import DanceTourCard from './DanceTourCard'


function DanceTour() {

  const cards = [
    {
      title: 'america',
      text: 'Lorem ipsum dolor sit amet,<br /> consectetur adipiscing elit.',
    },
    {
      title: 'america',
      text: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.',
    },
    {
      title: 'america',
      text: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.',
    }
  ]

  return (
      <>
        <div className='col-12'>
          <div className='text-center'>
            <h1>DANCE TOUR</h1>
            <h5>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus lacinia<br/> odio vitae vestibulum vestibulum. </h5>
          </div>
          <div className='col-md-12 d-flex flex-row justify-content-evenly'>
            <DanceTourCard title = {cards[0].title} text = {cards[0].text} />
            <DanceTourCard title = {cards[1].title} text = {cards[1].text} />
            <DanceTourCard title = {cards[2].title} text = {cards[2].text} />
          </div>
        </div>
      </>
  )
}

export default DanceTour
